import Header from "./Header";
import Card from "./Card";

function Main({cards}) {
  

  return (
    <>
      <Header />
      <main className="content">
      <section className="elements">
      <article className="element">
            <button className="element__add-button" />
        </article>
        {cards.map((card) => {
          return (
            <Card/>
          );
        })}
      </section>
    </main>
    <model-viewer
      src=""
      ar ar-modes="webxr scene-viewer quick-look" 
      camera-controls 
      poster="poster.webp" 
      shadow-intensity="1" 
      autoplay
      >
      </model-viewer>
    </>
  );
}

export default Main;
